import './Header.css';
import HeaderLog from '../../images/logo.svg'

function Header() {

  return (
    <div className="header">
      <div className='header__container'>
        <img className="logo logo_place_header" src={HeaderLog} alt="Круг" />
        <div className="navigation">
          <div className="navigation__profail navigation__profail_private">
            <button>Фильмы</button>
            <button>Сохраненные фильмы</button>
          </div>
          <div className='container-button'></div>
        </div>
      </div>
    </div>
  )
}

export default Header;
